 -->\n<blockquote class=\"wp-block-quote\"><p>A Companhia de Miniaturas XYZ foi fundada em 1971, e desde então tem fornecido miniaturas de qualidade ao público. Localizada na cidade de Itu, a XYZ emprega mais de 2.000 pessoas e faz coisas grandiosas para a comunidade da cidade.</p></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>Como um novo usuário do WordPress, você deveria ir ao <a href=\"http://localhost/projetos/rgs-consultoria/wp-admin/\">painel</a> para excluir essa página e criar novas páginas para o seu conteúdo. Divirta-se!</p>\n<!-- /wp:paragraph -->','Página de exemplo','','inherit','closed','closed','','2-revision-v1','','','2023-07-06 11:58:53','2023-07-06 14:58:53','',2,'http://rgs-consultoria.local/?p=87',0,'revision','',0),(88,1,'2023-07-06 11:59:21','2023-07-06 14:59:21','','cidadania portuguesa','','publish','closed','closed','','cidadania-portuguesa','','','2023-07-06 11:59:21','2023-07-06 14:59:21','',0,'http://rgs-consultoria.local/?page_id=88',0,'page','',0),(89,1,'2023-07-06 11:59:21','2023-07-06 14:59:21','','cidadania portuguesa','','inherit','closed','closed','','88-revision-v1','','','2023-07-06 11:59:21','2023-07-06 14:59:21','',88,'http://rgs-consultoria.local/?p=89',0,'revision','',0);
